import React, { Component } from 'react';
import Particles from "react-tsparticles";
import Navigation from './components/Navigation/Navigation';
import Logo from './components/Logo/Logo';
import ImageLinkForm from './components/ImageLinkForm/ImageLinkForm';
import Rank from './components/Rank/Rank';
import './App.css';

const particlesOptions = {
   particles: {
     color: {
         value: "#ffffff",
     },
     links: {
         color: "#ffffff",
         distance: 150,
         enable: true,
         opacity: 0.5,
         width: 1,
     },
     collisions: {
         enable: true,
     },
     move: {
         direction: "none",
         enable: true,
         outModes: {
             default: "bounce",
         },
         random: false,
         speed: 6,
         straight: false,
     },
     number: {
         density: {
             enable: true,
             area: 800,
         },
         value: 80,
     },
     opacity: {
         value: 0.5,
     },
     shape: {
         type: "circle",
     },
     size: {
         value: { min: 1, max: 5 },
     },
   }
}

class App extends Component {
   render() {
      return (
      <div className="App">
         <Particles className='particles'
           params={particlesOptions}
         />
         <Navigation />
         <Logo />
         <Rank />
         <ImageLinkForm />
         {/*   <FaceRecognition />*/}
      </div>
   );
   }
}

export default App;
